groups.mapping:
vec3 element_mapping(in vec3 ref_pos, in vec3 values[4]){ 
    vec3 result = vec3(0.,0.,0.);
    const float u1 = 1. - ref_pos.x - ref_pos.y - ref_pos.z;                                 
    const float v1 = ref_pos.x;                                                              
    const float w1 = ref_pos.y;                                                              
    const float z1 = ref_pos.z;                                                              
    float r = 0.; 
    r = 0. + 1*u1;
    result += r * values[0];
    r = 0. + 1*v1;
    result += r * values[1];
    r = 0. + 1*w1;
    result += r * values[2];
    r = 0. + 1*z1;
    result += r * values[3];
    return result;
}
